import styles from "./styles/Header.module.css";

function Header() {
  return (
    <div class="header">
      <form class="form-inline">
        <div class="phone">
          <p>Call 021 152 33789</p>
        </div>
        <div class="search">SEARCH</div>
      </form>
    </div>
  );
}

export default Header;
